import React, { useState } from 'react'
import './App.css';
import NavBar from './components/NavBar';
import Lorem from './components/Lorem';
import ProjectTabs from './components/ProjectTabs';
import SkillsMarquee from './components/SkillsMarquee'
import TechSkills from './components/TechSkills';
import Intro from './components/Intro'

function App() {
  const [stateIams, setstate] = useState(['Software Developer', 'Cat Daddy'])

  let stateVal = 0;


    function tick(){
        return stateVal += 1;
        let [index, setindex] = useState(stateVal)
    }
  setInterval(tick, 1000);

  return (
    <div className="App">
      <NavBar/>
      <Intro stateIams={stateIams} index={index}/>
      <h1 className='subheading' id='techStackTabs'>Technical Skills:</h1>
      <TechSkills/>
      {/* <SkillsMarquee/> */}
      <br/>
      <h1 className='subheading' id='projectTabs'>My Projects:</h1>
      <ProjectTabs/>
      <Lorem/>
      <Lorem/>
      <SkillsMarquee/>
    </div>
  );
}

export default App;
